import React, {useEffect, useState} from 'react';
import './../../App.scss'
import './Get.scss'

const Get = () => {
    let [page, setPage] = useState(1)
    let [users, setUsers] = useState([])
let url = `https://frontend-test-assignment-api.abz.agency/api/v1/users?page=${page}&count=6`

    const getUsers = async (url) => {
        return await fetch(url)
            .then(response => response.json())
    }

    useEffect(() => {
        getUsers(url)
            .then(data => setUsers(users.concat(data.users)))
    }, [])

    return (
        <section className='get__section'>
            <h1 className='get__title title'> Working with GET request</h1>
        </section>
    );
};

export default Get;
